import s from './AddInformation.module.css'

const AddInformation = ({item}) => {
    return(
        <div>
            <img className={s.itemImg} src={item.imageUrl}/>
            <div>{item.name}</div>
            <div>{item.description}</div>
            <div>{item.collar}</div>
            <div>{item.weight}</div>
        </div>
    )
}

export default AddInformation
